- input: "TEXT\x1CC00409623\x1CSB23.5712.TEXT\x1CSB23.5712\x1CSB23\x1COn June 25,
    2008, Synergy PAC issued a $2,000 contribution check to Chet Edwards for Congress.
    The check was believed to be lost, and a Stop Payment was placed on the check
    on September 12, 2008. These transactions were all reported to the FEC. In early
    July, 2009, the 'lost' check was apparently found and presented to and honored
